import React from 'react'

export default function Showresult03() {
    function handleNext(){
        return (
            <>
      <select >
        <option>Select RollNo</option>
        <option>1</option>
        <option>2</option>
        <option>3</option>
      </select>
      <br></br> <br></br>
      <button>Next</button>
    </>
        );
    }
  return (
    <>
      <select >
        <option>Select Department</option>
        <option>CSE</option>
        <option>ECE</option>
        <option>CI</option>
      </select>
      <br></br> <br></br>
      <button onClick={handleNext}>Next</button>
    </>
  )
}
